import React from "react";
import '../Common/style.css'
import { FaFacebook, FaInstagram } from "react-icons/fa";
import { Link, NavLink } from "react-router-dom";

function Navbar() {
    
  return (
    <>
      <div className="navbar">
        <div className="logo">
            <Link to="/">alexa <span>cafe</span></Link>
        </div>
        <div className="menu">
            <ul>
                <li><NavLink to="/">home</NavLink></li>
                <li><NavLink to="/AboutPage">menu</NavLink></li>
                <li><NavLink to="/AboutPage">about us</NavLink></li>
                <li><NavLink to="/AboutPage">contact us</NavLink></li>
            </ul>
        </div>
        <div className="social-media">
            <ul>
                <li><Link to="/" title="FaceBook"> <FaFacebook /> </Link></li>
                <li><Link to="/" title="Instagram"> <FaInstagram /> </Link></li>
            </ul>
        </div>
      </div>
    </>
  );
}
export default Navbar;
